import './App.css';
import {Route, Routes} from "react-router-dom";
import ComponentePrimos from "./components/ComponentPrimos";

function App() {
  return (
    <div className="App">
      <Routes>
          <Route path = 'primo' element = {<ComponentePrimos props = {6}/>}/>
      </Routes>
    </div>
  );
}

export default App;
